import React from "react";
import { Link } from "react-router-dom";
import { URLS } from './../constants/route-links';
import Collections from './collections';

const Navbar = () => {
  return (
    <nav className="w-full top-0 p-5 border ">
      <div className="flex px-3 items-center justify-between">
       <div className="">
        <Link to={URLS.Collections.url}>
          <img src={require('./assets/logo.svg')} alt="logo" className="w-12 h-12" />
        </Link>
            <p className=" font-sans text-Black font-bold text-3xl">Sneakers</p>
       </div>
      </div>
    </nav>
  );
};

export default Navbar;
